import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../../styles/admin.css'; // Импорт стилей

export default function AdminPanel() {
  const navigate = useNavigate();
  const [routes, setRoutes] = useState([]);
  const [newRoute, setNewRoute] = useState({
    from: '',
    to: '',
    date: '',
    price: '',
  });

  const handleLogout = () => {
    localStorage.removeItem('isAdmin');
    localStorage.removeItem('token'); // Если используете JWT
    navigate('/admin/login');
  };

  useEffect(() => {
    const isAdmin = localStorage.getItem('isAdmin') === 'true';
    if (!isAdmin) navigate('/admin/login');
  }, [navigate]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewRoute((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleAddRoute = (e) => {
    e.preventDefault();
    if (newRoute.from && newRoute.to && newRoute.date && newRoute.price) {
      setRoutes((prevRoutes) => [...prevRoutes, newRoute]);
      setNewRoute({ from: '', to: '', date: '', price: '' }); // Сбросить форму
    }
  };

  const handleDeleteRoute = (index) => {
    setRoutes((prevRoutes) => prevRoutes.filter((_, i) => i !== index));
  };

  return (
    <div className="admin-container">
      <header className="admin-header">
        <h1 className="admin-title">Панель администратора</h1>
        <button className="logout-btn" onClick={handleLogout}>
          Выйти
        </button>
      </header>
      
      <div className="admin-content">
        <h2>Управление маршрутами</h2>

        {/* Форма добавления маршрута */}
        <form onSubmit={handleAddRoute} className="add-route-form">
          <input
            type="text"
            name="from"
            placeholder="Откуда"
            value={newRoute.from}
            onChange={handleInputChange}
          />
          <input
            type="text"
            name="to"
            placeholder="Куда"
            value={newRoute.to}
            onChange={handleInputChange}
          />
          <input
            type="date"
            name="date"
            value={newRoute.date}
            onChange={handleInputChange}
          />
          <input
            type="text"
            name="price"
            placeholder="Цена"
            value={newRoute.price}
            onChange={handleInputChange}
          />
          <button type="submit" className="add-btn">Добавить рейс</button>
        </form>

        {/* Таблица маршрутов */}
        <table className="routes-table">
          <thead>
            <tr>
              <th>Откуда</th>
              <th>Куда</th>
              <th>Дата</th>
              <th>Цена</th>
              <th>Действия</th>
            </tr>
          </thead>
          <tbody>
            {routes.map((route, index) => (
              <tr key={index}>
                <td>{route.from}</td>
                <td>{route.to}</td>
                <td>{route.date}</td>
                <td>{route.price} ₽</td>
                <td>
                  <button className="delete-btn" onClick={() => handleDeleteRoute(index)}>Удалить</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
